The code fragment given below was intended to read values until a negative value was read and then to print the product of the positive values read. Unfortunately, it does not work. 

Scanner kbd = new Scanner(System.in); 
int x, product; product = 0;
x = kbd.nextInt(); 
while (x >= 0) { 
  if (x > 0) { 
    product *= x; 
  } 
  x = kbd.nextInt(); 
  } 
System.out.println(product); 

Which of the following best describes the error that prevents the code from computing the correct answer?,Loops,Variable x is not initialized correctly.,Variable product is not initialized correctly.,The loop is executed one too many times.,The loop is executed one two few times.,None of the mentioned,5,ChoiceB,Difficult,

